import React, { Component } from 'react';
import './App.css';

class Home extends Component {
  render() {
          return (
            <div class="col-md-6">
                    <div class="profile-head">
                                <h5>Emma Nguyen</h5>
                                <h6>Product Manager</h6>
                                </div>
                                </div>
          );
        }
      }
export default Home;
